import React from 'react';
import background from "../../images/Man-at-Computer-Image.jpg"

const Home = () => {
  return (
    <div class="hero min-h-screen bg-base-200">
      <div class="hero-content flex-col lg:flex-row-reverse">
        <img src={background} class="max-w-sm rounded-lg" alt='back' />
        <div>
          <h1 class="min-w-md text-5xl font-bold">MeetRoom: Video,Audio conferencing made simple</h1>
          <p class="py-6">There's lots to love about MeetRoom.Add flexibility, not complexity</p>
          <button class="btn btn-primary">Get Started</button>
        </div>
      </div>
    </div>
  );
};

export default Home;
